void InvMMatrix(const Standard_Integer classe,
		math_Matrix&           InvM)
{
  if (classe > 24) throw Standard_DimensionError("InvMMatrix: classe > 24");
  Standard_Integer i, j, k = 0, Som = 0;
  for (i = 2; i < classe; i++) {
    Som += (i)*(i);
  }
  for (i = 1; i <= classe; i++) {
    for (j = 1; j <= classe; j++) {
      InvM(i+InvM.LowerRow()-1, j+InvM.LowerCol()-1) = IMatrix[Som+k];
      k++;
    }
  }
}


